import React from "react";
import P, { Size, Weight } from "../components/atoms/P/P";
import Button from "../components/atoms/Button/Button";
import List, { Order } from "../components/molecules/List/List";
import ListItem from "../components/molecules/ListItem/ListItem";
const Home = () => {
  return (
    <div>
      <P size={Size.m} weight={Weight.m}>
        가모라~
      </P>
      <Button>버튼</Button>

      <List order={Order.center} card>
        <ListItem>아아아</ListItem>
        <ListItem>이이이</ListItem>
        <ListItem>우우우</ListItem>
      </List>
    </div>
  );
};

export default Home;
